import React, { useEffect, useState } from 'react'

const Profile = () => {

    // const [user, setUser] = useState({})
    const [email, setEmail] = useState("");
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");
  const [password, setPassword] = useState("");

    useEffect(()=>{
        const userData = JSON.parse(localStorage.getItem("user"))
        // setUser(userData)
        setFirstname(userData.firstName)
        setLastname(userData.lastName)
        setEmail(userData.lastName)

    },[])

  return (
    <div>
        <div className="container mt-5 mb-5">
            <h3>My Profile </h3>
            {
                    userData?
            <div className="row">

                    <div className="col-12">
                    <h6>First Name:</h6>
                    <input type="text" className="form-control mb-3" value={firstname} onChange={(e) => setFirstname(e.target.value)}/>

                </div>
                <div className="col-12">
                    <h6>Last Name:</h6>
                    <input type="text" className="form-control mb-3" value={lastname} onChange={(e) => setLastname(e.target.value)}/>
                </div>
                <div className="col-12">
                    <h6>Email:</h6>
                    <input type="email" className="form-control mb-3" value={email} onChange={(e) => setEmail(e.target.value)}/>
                </div>
                <div className="col-12">
                    <h6>First Name:</h6>
                    <input type="text" className="form-control mb-3" value={firstname} />
                </div>


            </div>
            :""
        }
        </div>

    </div>
  )
}

export default Profile
